import ImageList from './components/ImageList';


function App() {
    const handleSubmit = async (term) => {
        const result = await searchImages(term);
        console.log(result);
    }
    return (
        <div>
            <SearchBar onSubmit={handleSubmit} />
            <ImageList value={result} />
        </div>
    )
}

export default App;
